import React from "react"
import { Link } from "react-router-dom";
import { lightBlue, grey } from "@material-ui/core/colors";

export default function HomeIcon() {
    return (
        <p style={{
            color: lightBlue,
            backgroundColor: grey
        }}>
            <Link 
                to={"/"}
                style={{
                    fontFamily: "sans serif, verdana",
                    fontSize: 30,
                }}
            >
                NANOVERT
            </Link>
        </p>
    )
}
